wwv_flow_imp_page.create_page_plug(
 p_id=>wwv_flow_imp.id(21912202735693577)
,p_plug_name=>'Code'
,p_parent_plug_id=>wwv_flow_imp.id(21908927030693544)
,p_region_css_classes=>'u-shadow-md'
,p_icon_css_classes=>'fa-code'
,p_region_template_options=>'#DEFAULT#:t-Alert--horizontal:t-Alert--customIcons:t-Alert--info:t-Alert--removeHeading js-removeLandmark'
,p_plug_template=>2040683448887306517
,p_plug_display_sequence=>30
,p_plug_display_point=>'SUB_REGIONS'
,p_location=>null
,p_plug_source=>wwv_flow_string.join(wwv_flow_t_varchar2(
'<code>',
'-- Package Spec',
'TYPE country_rec IS RECORD ',
' (cca2                   countries.cca2%TYPE,',
'  flag                   countries.flag%TYPE,',
'  name_common            countries.name_common%TYPE,',
'  region                 countries.region%TYPE);',
'TYPE tt_countries IS TABLE OF country_rec; ',
'',
'-- Package Body',
'FUNCTION get_countries (p_region IN countries.region%TYPE) RETURN tt_countries PIPELINED IS',
'',
'  CURSOR cr_countries IS',
'    SELECT *',
'    FROM   countries',
'    WHERE  region = p_region;',
'',
'  row_data    country_rec;',
'',
'BEGIN',
'',
'  FOR r_country IN cr_countries LOOP',
'    -- Add Complex Logic Here.',
'    row_data.cca2        := r_country.cca2;',
'    row_data.flag        := r_country.flag;',
'    row_data.name_common := r_country.name_common;',
'    row_data.region      := r_country.region;',
'    pipe row(row_data); ',
'  END LOOP;',
'',
'EXCEPTION WHEN NO_DATA_NEEDED THEN ',
'  NULL; ',
'WHEN OTHERS THEN ',
'  RAISE; ',
'END get_countries;',
'</code>'))
,p_attributes=>wwv_flow_t_plugin_attributes(wwv_flow_t_varchar2(
  'expand_shortcuts', 'N',
  'output_as', 'HTML')).to_clob
);
